<script>
  // tab ordering: sort inputs by top offset then left offset
  const inputs = Array.from(document.querySelectorAll('.fillbox'));
  inputs.sort((a,b)=>{ const ra=a.getBoundingClientRect(); const rb=b.getBoundingClientRect(); if(Math.abs(ra.top-rb.top)>2) return ra.top-rb.top; return ra.left-rb.left; }).forEach((el,i)=>el.tabIndex = i+1);
  // tiny helper to export filled values as JSON for convenience
  function exportValues(){ const data={}; document.querySelectorAll('.fillbox').forEach(i=>data[i.id]={name:i.name,value:i.value}); const s=JSON.stringify(data,null,2); navigator.clipboard && navigator.clipboard.writeText(s); alert('Form values copied to clipboard (JSON)'); }
</script>
<div style='width:100%;text-align:center;margin-top:6mm;'>
<button onclick='exportValues()' style='padding:8px 12px;border-radius:4px;border:1px solid #2a7; background:#4CAF50;color:white;font-weight:600;'>Copy form values (JSON)</button>
</div>
